--
-- Table structure for table `orders`
--

DROP TABLE IF EXISTS `orders`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `orders` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `buyer_id` int(11) DEFAULT NULL,
  `product_id` int(11) DEFAULT NULL,
  `code` varchar(255) DEFAULT NULL,
  `detail` varchar(255) DEFAULT NULL,
  `created_at` datetime NOT NULL,
  `updated_at` datetime NOT NULL,
  `status` int(11) DEFAULT NULL,
  `title` varchar(255) DEFAULT NULL,
  `payment` int(11) DEFAULT NULL,
  `color` varchar(255) DEFAULT NULL,
  `mercado_pago_purchase_id` int(11) DEFAULT NULL,
  `user_id` int(11) DEFAULT NULL,
  `order_products_list_id` int(11) DEFAULT NULL,
  `payment_type` int(11) NOT NULL DEFAULT '0',
  `document_file_name` varchar(255) DEFAULT NULL,
  `document_content_type` varchar(255) DEFAULT NULL,
  `document_file_size` int(11) DEFAULT NULL,
  `document_updated_at` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `index_orders_on_buyer_id` (`buyer_id`),
  KEY `index_orders_on_product_id` (`product_id`),
  KEY `index_orders_on_mercado_pago_purchase_id` (`mercado_pago_purchase_id`),
  KEY `index_orders_on_user_id` (`user_id`),
  KEY `index_orders_on_order_products_list_id` (`order_products_list_id`),
  KEY `index_orders_on_status` (`status`),
  CONSTRAINT `fk_rails_63ebe60baa` FOREIGN KEY (`order_products_list_id`) REFERENCES `order_products_lists` (`id`),
  CONSTRAINT `fk_rails_68098a40c9` FOREIGN KEY (`mercado_pago_purchase_id`) REFERENCES `mercado_pago_purchases` (`id`),
  CONSTRAINT `fk_rails_d3775977e3` FOREIGN KEY (`buyer_id`) REFERENCES `buyers` (`id`),
  CONSTRAINT `fk_rails_dfb33b2de0` FOREIGN KEY (`product_id`) REFERENCES `products` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=261 DEFAULT CHARSET=latin1;
/*!40101 SET character_set_client = @saved_cs_client */;

